DROP TABLE IF EXISTS `co_component_item`;
CREATE TABLE `co_component_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `component_set_id` int(11) NOT NULL,
  `item_id` int(11) NOT NULL,
  `date_created` datetime NOT NULL,
  `date_expires` datetime DEFAULT NULL COMMENT 'Date the current period expires. ',
  `date_termination` datetime DEFAULT NULL,
  `is_auto_renew_enabled` tinyint(1) NOT NULL COMMENT 'Creates new transaction and extends date_termination by period_repeat_count * item.period days.',
  `is_renewable` tinyint(1) NOT NULL COMMENT 'Allows date_expires to be extended up until date_termination and indicates that the item is still in an active state. ',
  `period_repeat_count` int(11) NOT NULL DEFAULT '1' COMMENT 'The number of times the item period is repeated for each transaction.',
  `period` int(11) DEFAULT NULL,
  `quantity` int(11) NOT NULL DEFAULT '0',
  `price` double NOT NULL DEFAULT '0',
  `is_on_hold` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'True when auto renewal was not successful. We are waiting for payment information. ',
  `is_suspended` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `component_set_id` (`component_set_id`),
  KEY `item_id` (`item_id`),
  KEY `date_expires` (`date_expires`),
  KEY `is_renewable` (`is_renewable`),
  KEY `is_auto_renew_enabled` (`is_auto_renew_enabled`),
  KEY `date_termination` (`date_termination`),
  KEY `is_suspended` (`is_suspended`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


