DROP TABLE IF EXISTS `nr_contact`;
CREATE TABLE `nr_contact` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rand` int(11) unsigned NOT NULL,
  `company_id` int(11) DEFAULT NULL,
  `email` varchar(254) NOT NULL,
  `first_name` varchar(32) DEFAULT NULL,
  `last_name` varchar(32) DEFAULT NULL,
  `title` varchar(256) DEFAULT NULL,
  `twitter` varchar(64) DEFAULT NULL,
  `phone` varchar(64) DEFAULT NULL,
  `company_name` varchar(64) DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `region_id` int(11) DEFAULT NULL,
  `locality_id` int(11) DEFAULT NULL,
  `zip` varchar(16) DEFAULT NULL,
  `beat_1_id` int(11) DEFAULT NULL,
  `beat_2_id` int(11) DEFAULT NULL,
  `beat_3_id` int(11) DEFAULT NULL,
  `contact_role_id` int(11) DEFAULT NULL,
  `contact_media_type_id` int(11) DEFAULT NULL,
  `contact_coverage_id` int(11) DEFAULT NULL,
  `is_unsubscribed` tinyint(1) NOT NULL,
  `is_media_db_contact` tinyint(1) NOT NULL,
  `is_nr_subscriber` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_per_company` (`company_id`,`email`,`is_nr_subscriber`),
  KEY `beat_1_id` (`beat_1_id`),
  KEY `beat_2_id` (`beat_2_id`),
  KEY `beat_3_id` (`beat_3_id`),
  KEY `is_media_db_contact` (`is_media_db_contact`),
  KEY `region_id` (`region_id`),
  KEY `locality_id` (`locality_id`),
  KEY `email` (`email`),
  KEY `first_name` (`first_name`),
  KEY `last_name` (`last_name`),
  KEY `company_name` (`company_name`),
  KEY `contact_media_type_id` (`contact_media_type_id`),
  KEY `contact_role_id` (`contact_role_id`),
  KEY `contact_coverage_id` (`contact_coverage_id`),
  KEY `is_unsubscribed` (`is_unsubscribed`),
  KEY `rand` (`rand`),
  KEY `idx_query_beats_non_zero_1` (`is_media_db_contact`,`beat_1_id`),
  KEY `idx_query_beats_non_zero_2` (`is_media_db_contact`,`beat_2_id`),
  KEY `idx_query_beats_non_zero_3` (`is_media_db_contact`,`beat_3_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DELIMITER ;;

CREATE TRIGGER `before_insert_nr_contact` BEFORE INSERT ON `nr_contact` FOR EACH ROW
SET new.rand = floor(rand()*4294967296);;

DELIMITER ;

