DROP TABLE IF EXISTS `nr_content`;
CREATE TABLE `nr_content` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` char(36) NOT NULL,
  `company_id` int(11) NOT NULL,
  `type` enum('pr','news','audio','video','image','event','social','blog') DEFAULT NULL,
  `title` varchar(256) NOT NULL,
  `slug` varchar(128) DEFAULT NULL,
  `date_created` datetime NOT NULL,
  `date_publish` datetime NOT NULL,
  `date_updated` datetime NOT NULL,
  `is_published` tinyint(1) NOT NULL DEFAULT '0',
  `is_draft` tinyint(1) NOT NULL DEFAULT '0',
  `is_legacy` tinyint(1) NOT NULL DEFAULT '0',
  `is_under_review` tinyint(1) NOT NULL DEFAULT '0',
  `is_approved` tinyint(1) NOT NULL DEFAULT '0',
  `is_rejected` tinyint(1) NOT NULL DEFAULT '0',
  `is_premium` tinyint(1) NOT NULL DEFAULT '0',
  `is_credit_locked` tinyint(1) NOT NULL DEFAULT '0',
  `is_identity_locked` tinyint(1) NOT NULL DEFAULT '0',
  `is_under_writing` tinyint(1) NOT NULL DEFAULT '0',
  `is_excluded_from_news_center` tinyint(1) NOT NULL DEFAULT '0',
  `is_backdated` tinyint(1) NOT NULL DEFAULT '0',
  `cover_image_id` int(11) DEFAULT NULL,
  `is_scraped_content` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid` (`uuid`),
  UNIQUE KEY `slug` (`slug`),
  KEY `search` (`title`(255)),
  KEY `is_legacy` (`is_legacy`),
  KEY `is_under_review` (`is_under_review`),
  KEY `is_draft` (`is_draft`),
  KEY `date_publish` (`date_publish`),
  KEY `is_published` (`is_published`),
  KEY `company_id` (`company_id`),
  KEY `type` (`type`),
  KEY `is_credit_locked` (`is_credit_locked`),
  KEY `is_under_writing` (`is_under_writing`),
  KEY `date_created` (`date_created`),
  KEY `is_newsroom_only` (`is_excluded_from_news_center`),
  KEY `idx_report_press_releases` (`type`,`date_publish`,`is_premium`,`is_published`,`company_id`),
  KEY `is_backdated` (`is_backdated`),
  KEY `idx_type_is_draft_id` (`type`,`is_draft`,`id`),
  KEY `idx_type_is_scheduled_id` (`type`,`is_published`,`is_draft`,`id`),
  KEY `idx_type_is_published_id` (`type`,`is_published`,`id`),
  KEY `idx_type_id` (`type`,`id`),
  KEY `date_updated` (`date_updated`),
  KEY `idx_published` (`is_published`,`date_publish`),
  KEY `is_scraped_content` (`is_scraped_content`),
  KEY `is_published_is_draft_is_approved_date_publish` (`is_published`,`is_draft`,`is_approved`,`date_publish`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


