  `max_status` enum('not_assigned','assigned_to_writer','writer_request_details_revision','sent_back_to_writer','sent_to_customer_for_detail_change','customer_revise_details','written_sent_to_admin','admin_rejected','sent_to_customer','customer_rejected','customer_accepted') NOT NULL,
