DROP TABLE IF EXISTS `mot_user`;
CREATE VIEW `mot_user` AS select `mot_user_base`.`id` AS `id`,`mot_user_base`.`first_name` AS `first_name`,`mot_user_base`.`last_name` AS `last_name`,`mot_user_base`.`password` AS `password`,`mot_user_base`.`email` AS `email`,`mot_user_base`.`is_enabled` AS `is_enabled`,`mot_user_base`.`is_verified` AS `is_verified`,`mot_user_base`.`date_created` AS `date_created`,`mot_user_base`.`date_active` AS `date_active`,`mot_user_base`.`remote_addr` AS `remote_addr`,`mot_user_base`.`notes` AS `notes` from `mot_user_base`;

DROP TABLE IF EXISTS `nr_beat_group`;
CREATE VIEW `nr_beat_group` AS select `b`.`id` AS `id`,`b`.`name` AS `name`,`b`.`slug` AS `slug`,`b`.`description` AS `description`,`b`.`is_listed` AS `is_listed` from `nr_beat` `b` where (`b`.`id` = `b`.`beat_group_id`);

DROP TABLE IF EXISTS `nr_cat_group`;
CREATE VIEW `nr_cat_group` AS select `nr_cat`.`id` AS `id`,`nr_cat`.`name` AS `name`,`nr_cat`.`is_listed` AS `is_listed`,`nr_cat`.`slug` AS `slug` from `nr_cat` where (`nr_cat`.`id` = `nr_cat`.`cat_group_id`);

DROP TABLE IF EXISTS `nr_limit_email`;
CREATE VIEW `nr_limit_email` AS select `up`.`user_id` AS `user_id`,`up`.`id` AS `limit_id`,`p`.`package` AS `package`,`upc`.`total` AS `amount_total`,`upc`.`used` AS `amount_used`,`up`.`date_expires` AS `date_expires` from (((`co_plan` `p` join `co_plan_credit` `pc` on(((`p`.`id` = `pc`.`plan_id`) and (`pc`.`type` = 'EMAIL')))) join `co_user_plan` `up` on(((`p`.`id` = `up`.`plan_id`) and (`up`.`is_active` = 1)))) join `co_user_plan_credit` `upc` on(((`up`.`id` = `upc`.`user_plan_id`) and (`pc`.`id` = `upc`.`plan_credit_id`))));

DROP TABLE IF EXISTS `nr_limit_newsroom`;
CREATE VIEW `nr_limit_newsroom` AS select `up`.`user_id` AS `user_id`,`up`.`id` AS `limit_id`,`p`.`package` AS `package`,`upc`.`total` AS `amount_total`,`up`.`date_expires` AS `date_expires` from (((`co_plan` `p` join `co_plan_credit` `pc` on(((`p`.`id` = `pc`.`plan_id`) and (`pc`.`type` = 'NEWSROOM')))) join `co_user_plan` `up` on(((`p`.`id` = `up`.`plan_id`) and (`up`.`is_active` = 1)))) join `co_user_plan_credit` `upc` on(((`up`.`id` = `upc`.`user_plan_id`) and (`pc`.`id` = `upc`.`plan_credit_id`))));

DROP TABLE IF EXISTS `nr_limit_pr`;
CREATE VIEW `nr_limit_pr` AS select `up`.`user_id` AS `user_id`,`up`.`id` AS `limit_id`,`p`.`package` AS `package`,`upc`.`total` AS `amount_total`,`upc`.`used` AS `amount_used`,`upc`.`period` AS `period`,if((`pc`.`type` = 'PREMIUM_PR'),'PREMIUM','BASIC') AS `type`,if((`upc`.`period` in ('DAILY','WEEKLY','MONTHLY')),1,0) AS `uses_calculated`,`up`.`date_expires` AS `date_expires` from (((`co_plan` `p` join `co_plan_credit` `pc` on(((`p`.`id` = `pc`.`plan_id`) and (`pc`.`type` in ('PREMIUM_PR','BASIC_PR'))))) join `co_user_plan` `up` on(((`p`.`id` = `up`.`plan_id`) and (`up`.`is_active` = 1)))) join `co_user_plan_credit` `upc` on(((`up`.`id` = `upc`.`user_plan_id`) and (`pc`.`id` = `upc`.`plan_credit_id`))));

DROP TABLE IF EXISTS `nr_limit_writing`;
CREATE VIEW `nr_limit_writing` AS select `up`.`user_id` AS `user_id`,`up`.`id` AS `limit_id`,`p`.`package` AS `package`,`pc`.`available` AS `amount_total`,`upc`.`used` AS `amount_used`,`up`.`date_expires` AS `date_expires` from (((`co_plan` `p` join `co_plan_credit` `pc` on(((`p`.`id` = `pc`.`plan_id`) and (`pc`.`type` = 'WRITING')))) join `co_user_plan` `up` on(((`p`.`id` = `up`.`plan_id`) and (`up`.`is_active` = 1)))) join `co_user_plan_credit` `upc` on(((`up`.`id` = `upc`.`user_plan_id`) and (`pc`.`id` = `upc`.`plan_credit_id`))));

DROP TABLE IF EXISTS `nr_newsroom`;
CREATE VIEW `nr_newsroom` AS select `c`.`id` AS `company_id`,`c`.`company_contact_id` AS `company_contact_id`,`c`.`name` AS `company_name`,`c`.`newsroom` AS `name`,`c`.`source` AS `source`,`c`.`date_created` AS `date_created`,`c`.`newsroom_domain` AS `domain`,`c`.`newsroom_timezone` AS `timezone`,`c`.`user_id` AS `user_id`,`c`.`newsroom_is_active` AS `is_active`,`c`.`order_default` AS `order_default`,`c`.`is_archived` AS `is_archived`,`c`.`is_reseller_controlled` AS `is_reseller_controlled`,`c`.`newsroom_domain_base` AS `domain_base`,`c`.`is_deleted` AS `is_deleted` from `nr_company` `c`;

DROP TABLE IF EXISTS `nr_state`;
CREATE VIEW `nr_state` AS select `nr_region`.`id` AS `id`,`nr_region`.`name` AS `name`,`nr_region`.`abbr` AS `abbr` from `nr_region` where (`nr_region`.`country_id` = 474);

DROP TABLE IF EXISTS `nr_user`;
CREATE VIEW `nr_user` AS select `ub`.`id` AS `id`,`ub`.`first_name` AS `first_name`,`ub`.`last_name` AS `last_name`,`ub`.`password` AS `password`,`ub`.`email` AS `email`,`ub`.`is_enabled` AS `is_enabled`,`ub`.`is_admin` AS `is_admin`,`ub`.`is_verified` AS `is_verified`,`ub`.`is_reseller` AS `is_reseller`,`ub`.`date_created` AS `date_created`,`ub`.`date_active` AS `date_active`,`ub`.`remote_addr` AS `remote_addr`,`ub`.`notes` AS `notes`,`ub`.`raw_data` AS `raw_data`,`ub`.`is_new_user` AS `is_new_user`,`ub`.`virtual_source_id` AS `virtual_source_id`,`ub`.`virtual_source_email` AS `virtual_source_email`,`p`.`package` AS `package`,1 AS `is_migrated` from ((`nr_user_base` `ub` left join `co_user_plan` `up` on(((`ub`.`id` = `up`.`user_id`) and (`up`.`date_expires` > utc_timestamp()) and (`up`.`is_active` = 1)))) left join `co_plan` `p` on((`up`.`plan_id` = `p`.`id`)));

