INSERT INTO `nr_canned` (`id`, `title`, `content`) VALUES
(7,	'Your press release is not formatted correctly.',	'Please make sure to check the following:\n\n1. DO NOT use double spacing between your paragraphs. One space after each is enough.\n\n2. Your content should NOT be all clumped together on one line. \n\n3. If you have a bullet list, make sure to have at least a single space in between so your press release can be read properly. Use Shift + Enter\n\n4. DO NOT indent your paragraph.\n\n5. Make sure to have AT LEAST 2 paragraphs.'),
(10,	'Please check and rephrase your title.',	'Please rephrase your title. \n\nMake sure to check the following:\n\n1. Don\'t include industry specific jargon or technical terms in your title. Readers won\'t read your press release if the title is too technical.\n2. A striking headline must explain your topic instantly to all readers and convey why the press release is new and interesting. \n3. Do not make your title sound like an ad. \n4. Be brief and concise.\n5. Your title should not be too long nor too short.'),
(12,	'We only accept english press releases.',	'Unfortunately we only accept english written press releases at the moment. Please edit and submit an english version.'),
(15,	'Do not use www in the title.',	'Please do not use http:// or www in the title.'),
(16,	'Remove location/address from beginning.',	'We automatically add the Location to the dateline. Please remove from your press release.'),
(17,	'Remove date from beginning.',	'We automatically include your DATE in the dateline. Please remove date in the beginning since it automatically gets added upon publication. '),
(20,	'Lawsuit or slander related.',	'We apologize but it is our strict policy to not publish press releases related to any pending lawsuits or legal issues.'),
(21,	'Your submission has grammar/punctuation/spelling errors. Please check.',	'Your submission did not pass our editorial standards. Please make sure to check the following:\n\n1. Observe proper grammar.\n2. Observe proper spelling and punctuation marks.\n3. Use proper abbreviations or acronyms.\n4. Use proper spacing between sentences.\n5. Use proper capitalization.\n\nPlease edit and resubmit.'),
(22,	'Using the first person in your press release.',	'DO NOT USE \"I\", \"You\", \"We\", \"Your\", \"Our\", \"Us\" or any first person anywhere in your press release. Writing in the first person is more of an editorial piece than a newsworthy press release.  If you would like to include them, please rephrase your sentence in a quotation from a company spokesperson. Or use a third person.'),
(24,	'Too many links/URLs.',	'There are too many links/URLs in your press release. Please limit them to 3.'),
(25,	'No phone number in title.',	'Please remove phone numbers in your title.'),
(26,	'Move promotional messages and/or links to the end.',	'Please move any links and/or promotional messages from the opening of your press release to the end or conclusion of your release.'),
(27,	'No address in title.',	'Please remove the address in your title.'),
(28,	'Multiple releases with duplicate content.',	'Please make sure your press release submissions do not contain duplicate summaries or duplicate content. This is to ensure quality results for your company\'s press releases as well as maintaining our good standing with Google.'),
(29,	'Unnecessary lines, symbols or characters.',	'Please do not add unnecessary lines, symbols or characters to your press release. Also, make sure not to copy and paste your press release from a word program directly to the submission page as some characters may not be compatible.\n\nWe do allow usage of dashes and semi-colon, however, its best practice to phrase your title without them.'),
(30,	'Title should be written in title case.',	'Press release headlines should be written in title case.  You can use http://www.textcaseconverter.com/ to convert your title to title case.\n\n'),
(31,	'Title ends in a period.',	'Do not add a period at the end of your headline.'),
(32,	'The text \"For Immediate Release\" in the content.',	'All press releases are for immediate release. Please remove this from your press release. '),
(33,	'Remove \"News Release\" or \"Press Release\" in your press release.',	'Please do not add \"News Release\" or \"Press Release\" in your press release.'),
(34,	'Press release is incomplete/truncated.',	'Please check your submitted press release, it should have at least 250 words, 3 paragraphs. To resolve, clear cache and cookies from your browser then resubmit your press release. You can also try to use another browser.'),
(35,	'Your summary is incomplete.',	'Your summary is truncated. Please check and resubmit.'),
(36,	'Do not write your pr in bold letters or all caps.',	'Do not write your pr in bold or all caps even if it\'s important. Writing in bold or all caps is like shouting to your readers.'),
(37,	'Do not repeat your summary in the first paragraph of your pr.',	'Your summary should complement your headline without repeating it. It should include key benefits, statistics or a brief value statement in one to two lines that would entice the reader to want to learn more. '),
(39,	'Your submission sounds like an information/how to article.',	'Your submission is unacceptable because it sounds like an information/how to article. Please edit and resubmit.'),
(40,	'Your submission sounds like an advertisement pitch.',	'Your submission is unacceptable because it sounds like a blatant ad. Please make it sound like a news headline or an announcement. Please edit and resubmit.'),
(41,	'Your submission contains abusive or obscene material.',	'Your submission contains phrases/words containing abusive or obscene material.  This will not pass our editorial standards because it is against the standards of morality and decency. Please edit and make sure that the content has newsworthy material.'),
(42,	'Your submission is unsuitable for publication.',	'Your submission did not pass our editorial standards because we found it not sufficiently interesting to get a reader\'s attention. A press release is a written communication directed at members of the news media for the purpose of announcing something ostensibly newsworthy.\n\nPlease edit and make sure that the content has newsworthy material.'),
(43,	'Do not repeat your title anywhere in your submission.',	'Do not repeat your title anywhere in your submission. The summary and the body of the press release should complement your headline without repeating it.'),
(44,	'Do not put phone numbers in your title.',	'Please remove phone numbers from your title.'),
(45,	'We do not accept any submissions related to gambling.',	'We do not accept any submissions related to gambling.'),
(46,	'Your submissions involves a press release dealing with litigation.',	'We are unable to distribute any releases involving litigation cases through our distribution network. We apologize for any inconvenience and appreciate your understanding with this matter. Please let us know if you have any questions or concerns and we will be happy to discuss any alternative options.'),
(47,	'Missing Source Attribution',	'Please incorporate the Press Release Source name into the headline, summary and/or first paragraph of release to make clear the release is being sent out by [Source of Release] and kindly resubmit for review.');
