(2,	'/content-guidelines',	'',	'Content Guidelines and Editorial Review Process',	NULL,	NULL),
(3,	'/features/distribution',	'{}',	'Newswire Press Release Distribution Partners',	'press release distribution points, syndication outlets, list of sites for iNewswire distribution, iNewswire distribution points',	'iNewswire has forged hundreds of online syndication deals with media sites online such as blogs, news sites, niche sites and more.'),
(4,	'/how-it-works',	'{}',	'How Our Press Release Service Works at Newswire',	'how to submit a press release, press release submission, how iNewswire works, how to distribute a press release online',	'Learn how quick and easy it is to submit press releases at iNewswire. We make it simple and effect to get your news online.'),
(5,	'/pricing',	'{}',	'Newswire Pricing Plans for Press Release Distribution',	'iNewswire has forged hundreds of online syndication deals with media sites online such as blogs, news sites, niche sites and more.',	'iNewswire offers the most economical PR distribution service today; without sacrificing results. Our service is measurable and you get a customized PDF report.'),
(6,	'/why-us',	'{}',	'Why Choose Newswire for Your Press Release Campaign',	'why choose iNewswire, iNewswire review, review of i-newswire.com, benefits of iNewswire, press release service at i-newswire.com, press release distribution at iNewswire',	'iNewswire provides the fast, most economical press release distribution online that delivers real measurable results.'),
(7,	'/',	'{}',	'Press Release Distribution to Major News & Media Outlets',	'press release, press release distribution, free press release distribution',	'Press release distribution improves online visibility and helps you connect with target audiences around the world. Learn how to submit your press release.'),
(8,	'/register',	'{}',	'Register to Submit a Press Release',	'register now to submit your press releases, press release service registration, press release distribution registration, registration page to submit press releases',	'Register now at iNewswire to submit your press releases online quickly and easily.'),
