('bad_words_filter',	'Filter for blocked words or phrases with regular expression support.',	'YAML',	'# ==========================================================\n# This YAML document controls the bad words filter. \n# https://en.wikipedia.org/wiki/YAML\n# ==========================================================\n#  * each item must have a regex, term or string property\n#    @regex: any valid regular expression\n#    @term: word or phrase that must be matched (full match)\n#    @string: any sequence of characters (partial match)\n#    -----------------------------------------------\n#  * each item may have an optional message to the user\n#    @message: the message to show the user when it matches\n#    -----------------------------------------------\n#  * all tests are case insensitive \n# ==========================================================\n \ndefault_message: > \n\n  This term is now allowed.\n\nmessages: \n\n  - &obscene_words > \n    Obscene words are not allowed.\n\n  - &adult > \n    We do not allow adult content. \n\n  - &competitor > \n    Sorry you can\'t submit a release that promotes a competing company and or website\n\n  - &contact > \n    Please contact us for details on 1-800-713-7278\n\nfilters: \n\n  - regex: \'f+u+c+k+\'\n    message: *obscene_words\n\n  - regex: \'shit\'\n    message: *obscene_words\n\n  - regex: \'masturb(ate|ator|ating)\'\n    message: *obscene_words\n\n  - term: \'orgasm\'\n    message: *obscene_words\n\n  - term: \'cock\'\n    message: *obscene_words\n\n  - regex: \'\\bimmediate\\s*release\\b\'\n    message: >\n      Please remove this from the press release, \n      it is not required.\n\n  - regex: \'\\bescorts?\\b\'\n    message: *adult\n\n  - term: \'wlmarketing\'\n\n  - string: \'insurancenewsandmarkets.com\'\n\n  - regex: \'\\bindia\\s*mart\\b\'\n\n  - string: \'seoprwire\'\n\n  - term: \'donald zuma\'\n\n  - term: \'cliffside malibu\'\n\n  - term: \'thechemistryhomeworkhelp\'\n\n  - string: \'samrx\'\n    message: \'No RX sites allowed\'\n\n  - regex: \'\\bsubmit\\s*edge\\b\'\n\n  - string: \'prnewschannel.com\'\n    message: *competitor\n\n  - string: \'free-press-release.com\'\n    message: *competitor\n\n  - string: \'fwmmo.com\'\n\n  - term: \'e business financial\'\n\n  - term: \'global web solutions\'\n\n  - string: \'prnotice.com\'\n    message: *competitor\n\n  - string: \'pressreleasenotice.com\'\n    message: *competitor\n\n  - string: \'weballin1.com\'\n\n  - regex: \'\\bcross\\s*dress\\b\'\n\n  - regex: \'\\bfree\\s*PR\\s*now\\b\'\n\n  - regex: \'\\bcanada\\s*pharmacy\\b\'\n    message: > \n      Your company has abused our site and created more than one account. \n      Because of this you are no longer allowed to submit press release to our site.\n\n  - term: \'payday loan\'\n    message: > \n      We don\'t accept payday loan press releases.\n\n  - term: \'sex toy\'\n    message: *contact\n\n  - regex: \'Avesta Capital\'\n    message: *contact'),
