('cfhc_litigation_terms',	'Terms used to detect content that contains litigation.',	'TEXT',	'# ========================================================\n#  This is a list of terms that will trigger litigation\n#  detection on the PR submission form. \n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line will be counted as a term\n# ========================================================\n\narrest\narrested\ncase no\ncase number\nconvicted\ncourt case\ncourt\ndefendant\ndocket number\nfraud\nfraudulent\ngrand jury\nillegal\nindicted\nindictment\njury\nlawsuit\nlibel\nlitigation\nplaintiff\nprosecutor \nsettlement \nslander\ntrial motions\nverdict\nyuneec\nYuneec'),
