('staff_email_industry_outreach',	'Email addresses of those who want industry outreach notifications',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will receive\n#  an email notification when industry outreach campaign is \n#  submitted. At the time of writing this is used only\n#  for PressRelease.com but will be used for others as needed. \n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nanthony@inewswire.com\nerik@inewswire.com\nmikesantiago@gmail.com\npatrick@inewswire.com\ndominick@inewswire.com'),
('staff_email_order_receipts',	'Email addresses of those who want a copy of order receipts',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will get a copy\n#  of the order receipts sent out to customers when \n#  any order is placed (member or new customer). \n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nerik@inewswire.com\nmikesantiago@gmail.com\npatrick@inewswire.com\nanthony@inewswire.com\n'),
('staff_email_outreach_marked_spam',	'Email addresses of those who want emails when the outreach campaign is marked as spam',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will receive\n#  an email when an outreach campaign is marked as spam\n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nanthony@newswire.com\nerik@newswire.com\npatrick@newswire.com\ndominick@newswire.com'),
('staff_email_pr_sales_planner',	'Email addresses of those who want emails when the PR planner is filled in',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will receive\n#  an email containing data to be used for customer outreach.\n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nanthony@newswire.com\nerik@newswire.com\npatrick@newswire.com'),
('staff_email_release_plus',	'Email addresses of those who want release plus notifications',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will receive\n#  an email notification when Release Plus content is \n#  submitted. At the time of writing this is used only\n#  for PR Newswire but will be used for others as needed. \n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nanthony@inewswire.com\nerik@inewswire.com\nmikesantiago@gmail.com\npatrick@inewswire.com\ndominick@inewswire.com'),
('staff_email_status_report',	'Email addresses of those who want the daily status report',	'TEXT',	'# ========================================================\n#  This is a list of email addresses that will receive\n#  the daily status report with financial data for the\n#  previous day and 30 day period. It includes some \n#  data on transactions and new users in the attached files.\n# ========================================================\n#  * add comments with a hash at the start of the line\n#  * each non-blank line must be a valid email address\n# ========================================================\n\nanthony@newswire.com\nerik@newswire.com\nmike@iadvantage.com\nmikesantiago@gmail.com\nshozeb@gmail.com\npatrick@newswire.com'),
('summary_max_length',	'The maximum length (in characters) of the summary text on content.',	'INTEGER',	'140'),
