INSERT INTO `nr_video_guide` (`id`, `section`, `external_video_provider`, `external_video_id`, `title`, `content`, `stored_image_id`, `date_updated`) VALUES
(1,	'publish',	'Video_Youtube',	'YfZesicuDtY',	'What is iPublish?',	'<p>iPublish is the section where you can submit, organize and manage your content. From press releases, news, images and more, you can sort and easily schedule your content.&nbsp;</p>',	1499,	'2014-04-02 19:20:21'),
(2,	'publish',	'Video_Youtube',	'EeyxePszPWc',	'Submit a Press Release',	'<p>Submitting a press release is simple. When you have your press release ready, use our easy to follow form, preview your release and submit for editorial review. You can manage your press release all on one place.</p>',	1501,	'2014-02-20 21:29:42'),
(3,	'publish',	'Video_Youtube',	'ugBb-padH1M',	'Submit Other Types of Content',	'<p>Submit your news, events, images, audio and video to your newsroom. Follow the easy steps to submitting and publishing your content online.&nbsp;</p>',	1502,	'2014-02-20 21:29:59'),
(5,	'contact',	'Video_Youtube',	'aMsCGfEcUt4',	'What is iContact?',	'<p>IContact enables you to add, manage and organize your email campaigns and contacts. Easily import your email lists and schedule out your pitch.&nbsp;</p>',	1547,	'2014-02-20 21:31:57'),
(6,	'contact',	'Video_Youtube',	'a-lQCbN2JEQ',	'Create Contact List and Import',	'<p>Adding your contacts is easy. You can use the import template to prepare your email list from your records. You can also add contacts one by one as well. iContact is flexible.</p>',	1551,	'2014-02-20 21:33:31'),
(7,	'contact',	'Video_Youtube',	'yac6vMe0j8I',	'Setting Up an Email Campaign',	'<p>Email campaigns are a breeze to set up. Simply select &quot;New Campaign&quot; then select the content you want to promote and pitch. Watch how simple it is.</p>',	1552,	'2014-02-20 21:34:50'),
(8,	'analyze',	'Video_Youtube',	'eT4hsKyHSkQ',	'What is iAnalyze?',	'<p>IAnalyze enables you to track and view your content&#39;s performance. From views to locations, you can easily track the enagement of your content from press release, news to your newroom stats.</p>',	1553,	'2014-02-20 21:36:43'),
(9,	'analyze',	'Video_Youtube',	'rFI-n8_76Cw',	'Email Stats',	'<p>Under iAnalyze, you can view your email campaign stats. From open rate to click you can track the effectiveness of your email marketing efforts in his section.</p>',	1554,	'2014-02-20 21:39:51'),
(11,	'analyze',	'Video_Youtube',	'N0Gl3g16kYo',	'Newsroom Stats ',	'<p>Your Newsroom is an integral part of your online presense. If you have an active newsroom, you can view the number of view as well as your visitor&#39;s locations to your newsroom. You can learn additional valuable infomation if you also install your Google Analyitics to your settings.</p>',	1555,	'2014-02-20 21:42:10'),
(12,	'analyze',	'Video_Youtube',	'QmHpSuZ6E3g',	'Settings for Email Notification ',	'<p>Under iAnalyze, you can also receive automatic email notification regarding your PDF reporting and newsroom stats. Simply set up the email addresses and how often you would like to be updated.</p>',	1557,	'2014-02-20 21:44:14'),
(13,	'publish',	'Video_Youtube',	'_4fPO4F8OIU',	'What is iNewsroom?',	'<p>iNewsroom is a feature of the member panel where you can manage and customize your newsroom settings. You can also customize your web address along with your press contact for your company.</p>',	1558,	'2014-02-20 21:46:32'),
(14,	'newsroom',	'Video_Youtube',	'2ItzU3LojDc',	'What is a Newsroom?',	'<p>Newsrooms help provide valuable information to journalists, reporters, media and your consumers. Its a central hub for the latest updates for your company news. Learn more about the features of iNewswire&#39;s Newsrooms.</p>',	1560,	'2014-02-20 21:48:49'),
(15,	'newsroom',	'Video_Youtube',	'oDQEGzoebds',	'Adding a Press Contact',	'<p>Adding a press contact is easy. Your press contact will be the point of contact for all your media relations. Learn how to manage and add your press contact.</p>',	1561,	'2014-02-20 21:50:05'),
(16,	'newsroom',	'Video_Youtube',	'vu68z6sIiP4',	'How to Customize Your Newsroom',	'<p>Customizing your Newsroom is simple. You can update the look of your newroom to match your corporate branding. Learn how you can add a logo, update your address and more by watching this video.</p>',	1562,	'2014-02-20 21:52:01'),
(17,	'newsroom',	'Video_Youtube',	'6SdZmTGPPes',	'Adding Your Social Media Profiles',	'<p>Do you have Facebook, Twitter, LinkedIn, G+ and more? You can add your social media profiles directly into your Newsroom. Learn more by watching this video.</p>',	1563,	'2014-02-20 21:53:31'),
(18,	'welcome-migrated',	'Video_Youtube',	'zMm8dda20V8',	'Migration Overview',	'',	1613,	'2014-04-01 15:30:35'),
(19,	'newswire',	'Video_Youtube',	'2ItzU3LojDc',	'What is a Company Newswire?',	'<p>Company Newswires help provide valuable information to journalists, reporters, media and your consumers. Its a central hub for the latest updates for your company news. Learn more about the features of Newswires.</p>',	1560,	'2015-03-11 11:43:15'),
(20,	'newswire',	'Video_Youtube',	'oDQEGzoebds',	'Adding a Press Contact',	'<p>Adding a press contact is easy. Your press contact will be the point of contact for all your media relations. Learn how to manage and add your press contact.</p>',	1561,	'2015-03-11 11:38:21'),
(21,	'newswire',	'Video_Youtube',	'vu68z6sIiP4',	'How to Customize Your Company Newswire?',	'<p>Customizing your Company Newswire is simple. You can update the look of your newroom to match your corporate branding. Learn how you can add a logo, update your address and more by watching this video.</p>',	1562,	'2015-03-11 11:42:30'),
(22,	'newswire',	'Video_Youtube',	'6SdZmTGPPes',	'Adding Your Social Media Profiles',	'<p>Do you have Facebook, Twitter, LinkedIn, G+ and more? You can add your social media profiles directly into your Company Newswire. Learn more by watching this video.</p>',	1563,	'2015-03-11 11:42:43');
